import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getAllUsers } from "../../action/UserAction";
import AddBoxIcon from '@mui/icons-material/AddBox';
import { padding } from "@mui/system";

const ShareCalendarForm = ({calendar_id}) => {
    const UserStore = useSelector(store => store.User)

    const dispatch = useDispatch()
    useEffect ( () => {
        dispatch(getAllUsers())
    },[dispatch])
    let AllUsers = UserStore.allUsers
    if (AllUsers === undefined) {
        AllUsers = []
    }
    else {
        console.log(AllUsers);
    }

    return ( 
        <div>
            {AllUsers.map( users => {
                return(<p style={{
                    border:'1px solid black',
                    padding:'5px'
                }} key={users.id}>{users.login} <AddBoxIcon style={{float:'right'}}></AddBoxIcon></p>)
            })}
        </div>
    )
}

export default ShareCalendarForm
